import React, { Component } from 'react';
import "./style.css";

class Greet extends Component {
    render() {
        return (
            <div className="greet">
                <h1 className="display-3">
                    Algoverse
                </h1>
                <hr className="dropdown-divider" />
                <h1 className="display-5">
                    Project By:
                </h1>
                <div className="project-names">
                    <p>Alok Yadav</p>
                    <p>Amit Kumar</p>
                    <p>Ayush Khare</p>
                </div>
            </div>
        );
    }
}

export default Greet;
